    // "& .MuiDataGrid-footerContainer":{
    //   display:"none !important",
    // }
  },
}));

export default function TableMUI() {
  const classes = useStyles();
  const [selectedRows, setSelectedRows] = useState([]);

  const handleRowClick = (params) => {
    const selectedRowIds = selectedRows.map((row) => row.id);

    if (selectedRowIds.includes(params.id)) {
      setSelectedRows(selectedRows.filter((row) => row.id !== params.id));
    } else {
      setSelectedRows([...selectedRows, params.row]);
    }
  };

  const isCellSelected = (params) => {
    const selectedRowIds = selectedRows.map((row) => row.id);
    return selectedRowIds.includes(params.id);
  };

  const [tableData, setTableData] = useState([])
    useEffect(() => {
      // fetch("https://jsonplaceholder.typicode.com/posts")
      axios.get("http://localhost:8080/HrcBackend/readdata").then((response) => setTableData(response.data))
        // .then((data) => data.json())
        // .then((data) => setTableData(data))
  
    }, [])
  
    console.log(tableData);
  



  return (
    <div className={classes.container} style={{ height: 500, width: "1300px" }}>
      <DataGrid
        classes={{
          root: classes.root,
          columnHeader: classes.columnHeader,
        }}
        style={{
          backgroundColor: "#666666",
          color: "#FFFFFF",
          //  border: '10px solid #FC7500',
        }}
        getRowId={(row) => row.sl_no}
        rows={tableData}
        columns={columns}
        checkboxSelection
        hideFooterSelectedRowCount
        scrollbarSize={10}
        isCellSelected={isCellSelected}
        onRowClick={handleRowClick}
      />

      <div className={classes.butt}>
        <ButtonGroup>
          <Button
            style={{
              color: "white",
              backgroundColor: "#fc7500",
              marginRight: "10px",
            }}
            variant="contained"
          >
            REFRESH DATA
          </Button>
          <Button
            style={{
              color: "white",
              backgroundColor: "#fc7500",
              marginRight: "10px",
            }}
            variant="contained"
          >
            EDIT
          </Button>
          <Button
            style={{
              color: "white",
              backgroundColor: "#fc7500",
              marginRight: "10px",
            }}
            variant="contained"
          >
            DELETE
          </Button>
          <Button
            style={{ color: "white", backgroundColor: "#fc7500" }}
            variant="contained"
          >
            PREDICT
          </Button>
        </ButtonGroup>
      </div>
    </div>
  );
}
